import * as React from "react";
import {
  Box,
  ThemeProvider,
  createTheme,
  FormControl,
  InputLabel,
  MenuItem,
  Select,
  TextField,
  Typography,
  Button,
} from "@mui/material";
import { useState, Component } from "react";
import Dropzone from "react-dropzone";
import md5 from "md5";
import { border } from "@mui/system";

export const CreateProduct = () => {
  const [name, setName] = useState();
  const [itemFile, setItemFile] = useState();
  const [itemBlockchain, setItemBlockchain] = useState();
  const [itemTag, setItemTag] = useState();
  const [itemExternalLink, setItemExternalLink] = useState();
  const [itemQuantity, setItemQuantity] = useState();
  const [ItemObject, setItemObject] = useState();
  const [itemDescription, setItemDescription] = useState();

  const addItem = (event) => {
    event.preventDefault();
    setItemObject({
      name,
      id: Math.random(),
      file: itemFile,
      blockchain: itemBlockchain,
      tag: itemTag,
      externalLink: itemExternalLink,
      quantity: itemQuantity,
      description: itemDescription,
    });
  };
  console.log(ItemObject);

  return (
    <Box
      sx={{
        alignItems: "flex-start",
        display: "flex",
        flexDirection: "row",
        bgcolor: "#E74C3C",
      }}
    >
      <Box
        sx={{
          alignItems: "flex-start",
          display: "flex",
          flexDirection: "column",
          bgcolor: "#2874A6",
        }}
      >
        <Box
          sx={{
            bgcolor: "#FCF3CF",
            boxShadow: 1,
            borderRadius: 5,
            p: 2,
            //minWidth: 300,
          }}
        >
          <TextField
            id="outlined-multiline-flexible"
            label="Name"
            multiline
            maxRows={4}
            value={itemDescription}
            onChange={(e) => setItemDescription(e.target.value)}
          />
        </Box>
        <Box
          sx={{
            bgcolor: "#EBDEF0",
            boxShadow: 1,
            borderRadius: 5,
            p: 2,
            //minWidth: 300,
          }}
        >
          <TextField
            label="Name"
            error={!name && "Name is empty"}
            helperText={!name && "Please"}
            value={name}
            onChange={(e) => setName(e.target.value)}
          />
        </Box>
        <Box
          sx={{
            bgcolor: "#FCF3CF",
            boxShadow: 1,
            borderRadius: 5,
            p: 2,
            //minWidth: 300,
          }}
        >
          <TextField
            id="outlined-multiline-flexible"
            label="External Link"
            multiline
            maxRows={4}
            value={itemExternalLink}
            onChange={(e) => setItemExternalLink(e.target.value)}
          />
        </Box>
        <Box
          sx={{
            bgcolor: "#EBDEF0",
            boxShadow: 1,
            borderRadius: 5,
            p: 2,
            //minWidth: 300,
          }}
        >
          <TextField
            id="outlined-multiline-flexible"
            label="Quantity"
            multiline
            maxRows={4}
            value={itemQuantity}
            onChange={(e) => setItemQuantity(e.target.value)}
          />
        </Box>
      </Box>
      <Box
        sx={{
          alignItems: "flex-start",
          display: "flex",
          flexDirection: "column",
          bgcolor: "#F1C40F",
        }}
      >
        <Box
        sx={{
          bgcolor: "#FCF3CF",
          boxShadow: 1,
          borderRadius: 5,
          p: 2,
          //minWidth: 300,
        }}
      >
        <Typography>select tag</Typography>
        <FormControl sx={{ m: 1, minWidth: 120 }} size="small">
          <InputLabel id="demo-select-small">blockchain</InputLabel>
          <Select
            labelId="demo-select-small"
            id="demo-select-small"
            value={itemBlockchain}
            label="Tag"
            onChange={(e) => setItemBlockchain(e.target.value)}
          >
            <MenuItem value="">
              <em>None</em>
            </MenuItem>
            <MenuItem value={1}>blockchain1</MenuItem>
            <MenuItem value={2}>blockchain2</MenuItem>
            <MenuItem value={3}>blockchain3</MenuItem>
          </Select>
        </FormControl>
      </Box>
        <Box
          sx={{
            bgcolor: "#FCF3CF",
            boxShadow: 1,
            borderRadius: 5,
            p: 2,
            border: 1,
            //minWidth: 300,
          }}
        >
          <Dropzone onDrop={(itemFile) => setItemFile(itemFile)}>
            {({ getRootProps, getInputProps }) => (
              <section>
                <div {...getRootProps()}>
                  <input {...getInputProps()} />
                  <p>Drag 'n' drop some files here, or click to select files</p>
                </div>
              </section>
            )}
          </Dropzone>
        </Box>
        <Box
          sx={{
            bgcolor: "#EBDEF0",
            boxShadow: 1,
            borderRadius: 5,
            p: 2,
            //minWidth: 100,
          }}
        >
          <Typography>select tagðŸ˜ˆ</Typography>
          <FormControl sx={{ m: 1, minWidth: 120 }} size="small">
            <InputLabel id="demo-select-small">Tag</InputLabel>
            <Select
              labelId="demo-select-small"
              id="demo-select-small"
              value={itemTag}
              label="Tag"
              onChange={(e) => setItemTag(e.target.value)}
            >
              <MenuItem value="">
                <em>None</em>
              </MenuItem>
              <MenuItem value={1}>Art</MenuItem>
              <MenuItem value={2}>Music</MenuItem>
              <MenuItem value={3}>Photo</MenuItem>
            </Select>
          </FormControl>
        </Box>
      </Box>



      <Box>
        <Button variant="contained" onClick={addItem}>
          create
        </Button>
      </Box>
    </Box>
  );
};
